import React from 'react';
import { Route, Routes, Navigate } from 'react-router-dom';
import LoginGuard from 'src/components/LoginGuard';
import RouterGuard from 'src/components/RouterGuard';

export const renderRoutes = (route) => (
  <React.Suspense fallback={<div>Loading...</div>}>
    {/* {<InterceptorComponent/>} */}
    <Routes>
      {
        routes.map((route, i) => {
          const RouteElement = route.element;
          const RouteLayout = route.layout || React.Fragment
          const RouteGuard = route.guard || LoginGuard;
          return (
            <Route key={i} path={route.path}
              element={
                <RouteGuard>
                  <RouteLayout>
                    <RouteElement />
                  </RouteLayout>
                </RouteGuard>

              }
            />
          )
        })
      }
    </Routes>
  </React.Suspense>
);


export const routes = [
  // define [home / 404]
  {
    path: '/home',
    layout: React.lazy(() => import('src/layouts/DashboardLayout')),
    element: React.lazy(() => import('src/views/home')),
  },
  {
    path: '/404',
    guard : RouterGuard,
    element: React.lazy(() => import('src/views/errors/NotFoundView')),
  },
  // customize  routes
  {
    path: '/login',
    guard : RouterGuard,
    element: React.lazy(() => import('src/views/signIn')),
  },


  // define [redirect(=Navigate )]
  {
    path: "/",
    element: () => <Navigate replace to="/home" />
  },
  {
    path: "/*",
    element: () => <Navigate replace to="/404" />
  }
];
